INSERT INTO srtdoc VALUES (5, 'Geregistreerd partnerschapsakte', 'Akte van geregistreerd partnerschap, opgenomen in de registers van de burgerlijke stand in Nederland, zoals bedoeld in artikel 2.8 lid 1 sub a, dan wel artikel 2.8 lid 2 sub a', 1);
INSERT INTO srtdoc VALUES (6, 'Be?indiging geregistreerd partnerschapsakte', 'Akte van het be?indigen van het geregistreerd partnerschap van het in het buitenland aangegaan geregistreerd partnerschap, opgenomen in de registers van de burgerlijke stand in Nederland, zoals bedoeld in artikel 2.8 lid 1 sub a', 1);
INSERT INTO srtdoc VALUES (7, 'NL akte overig', 'Akte opgemaakt door de ambtenaar van de burgerlijke stand, zoals bedoeld in artikel 2.8 lid 1 sub b', 2);
INSERT INTO srtdoc VALUES (8, 'Besluit', 'Besluit over in Nederland voorgedane feiten, zoals bedoeld in artikel 2.8 lid 1 sub b', 2);
INSERT INTO srtdoc VALUES (9, 'Nederlandse rechterlijke uitspraak', 'Een in kracht van gewijsde gegane rechterlijke uitspraak over feiten die zich hebben voorgedaan in Nederland en/of waarvan de rechterlijke uitspraak gedaan is in Nederland, zoals bedoeld in artikel 2.8 lid 1 sub b en artikel 2.8 lid 2 sub b', 2);
INSERT INTO srtdoc VALUES (10, 'Notari?le akte', 'Notari?le akte zoals bedoeld in artikel 2.8 lid 1 sub b.', 2);
INSERT INTO srtdoc VALUES (11, 'Consulaire akte', 'Een door een in Nederland geaccrediteerde consulaire ambtenaar van een ander land bevoegd opgemaakte akte die ten doel heeft een in Nederland voorgedaan feit te bewijzen, zoals bedoeld in artikel 2.8 lid 3', NULL);
INSERT INTO srtdoc VALUES (12, 'Buitenlandse akte', 'Een buiten Nederland overeenkomstig de plaatselijke voorschriften door een bevoegde instantie opgemaakte akte die ten doel heeft tot bewijs te dienen van het desbetreffende feit, zoals bedoeld in artikel 2.8 lid 2 sub c', 2);
INSERT INTO srtdoc VALUES (13, 'Buitenlandse rechterlijke uitspraak', 'Een uitspraak door een niet-Nederlandse rechter over buiten Nederland voorgedane feiten, zoals bedoeld in artikel 2.8 lid 2 sub c', 2);
INSERT INTO srtdoc VALUES (14, 'Akte van bekendheid', 'Een akte van bekendheid volgens artikel 1:45 Burgerlijk wetboek, zoals bedoeld in artikel 2.8 lid 2 sub c', 3);
INSERT INTO srtdoc VALUES (15, 'Be?digde verklaring', 'Een be?digde verklaring volgens artikel 1:45 Burgerlijk wetboek, zoals bedoeld in artikel 2.8 lid 2 sub c', 3);
INSERT INTO srtdoc VALUES (16, 'Geschrift', 'Een geschrift dat overeenkomstig de plaatselijkevoorschriften is opgemaakt door een bevoegde instantie waarin het zich desbetreffende feit is vermeld, zoals bedoeld in artikel 2.8 lid 2 sub d', 4);
INSERT INTO srtdoc VALUES (17, 'Verklaring onder ede of belofte', 'Een verklaring onder ede of belofte over in een ander land voorgedane feiten gedaan ten overstaan van een door College B&W aangestelde ambtenaar, zoals bedoeld in artikel 2.8 lid 2 sub e', 5);
